import React, {Component} from 'react';
import "./index.css"

class Search extends Component {
    render() {
        return (
            <div>
                <form className={"search"}>
                    <input type={"text"} className={"SearchInput"}/>
                    <input type={"submit"} className={"SearchButton"}/>
                </form>
            </div>
        );
    }
}

export default Search;
